import "./style.css";
import Hero from "../components/Hero";
import strings from "../strings.json";
import { Container, Row, Col } from "react-grid-system";

export default () => {
    return <Container>
        <Row className="header">
            <Col xs={4}><img src="/logo.svg" /></Col>
            <Col xs={8}>
                <a href="#">{strings.english.header.OurMission}</a>
                <a href="#">{strings.english.header.Terms}</a>
            </Col>
        </Row>
        <div className="center">
            <Hero />
        </div>
    </Container>
}
